import "./App.css";
import Tasks from './components/Tasks';
import AddTask from  './components/AddTask';

const App = () => {
  //const message = 'Hello world!'
  const [tasks, setTasks] = useState([
    {
      id: "1",
      title: "Estudar Programação",
      compiled: false,
    },
    {
      id: "2",
      title: "Ler Livros",
      completed: true,
    },

  ]);
  return (
    <>
  <div className="container">
    <AddTask />
    <Tasks tasks={tasks} />
  </div>

  </>
  );
};

export default App;
